import React from "react";

const Article = ({ article }) => (
    <div className="m-8 p-5 border border-gray-400 hover:border-blue-500">
        <a
            target="_blank"
            href="https://nextjs.org/docs"
            className="text-left no-underline text-gray-800"
        >
            <h3 className="m-0 text-blue-500 text-lg font-bold">
                Documentation &rarr;
            </h3>
            <p className="m-0 pt-3 py-0 pb-0 text-sm text-gray-900">
                Learn more about Next.js in the documentation.
            </p>
        </a>
    </div>
);

export default Article;
